import React, { useContext } from "react";
import './login.css';
import FirebaseContext from '../Firebase'
import { Link, useHistory } from 'react-router-dom'
import { Formik, Form, Field } from 'formik'


function Register(props) {


  return (

    <div className="register-page">
      <div className="form">

        <Formik
          initialValues={{ username: '', password: '' }}
          onSubmit={async (values, { setSubmitting }) => {
            try {
              //wait until log in is complete
              await firebase.auth.signInWithEmailAndPassword(values.username, values.password)
              // setLoading(false)
              // if (from.pathname !== "/") {
              //   history.replace(from);
              // }
              // history.replace("apply");
            } catch (error) {
              alert(error)
            }
          }}
        >
          <Form className="register-form">
            <Field as="input" type="text" placeholder="name" name="name" />
            <Field as="input" type="email" placeholder="email" name="email" />
            <Field as="input" type="password" placeholder="password" name="password" />
            <button type="submit">Sign Up</button>
            <p className="message">Already registered? <Link to="/login">Sign In</Link></p>
          </Form>
        </Formik>


      </div>
    </div>

  );
}

export default Register;
